import React from 'react'
import { moves } from './data'
import PokeMoveCard from './PokeMoveCard'

const PokeMoves = () => {
  return (
    <div>
        <h1>PokeMoves</h1>
        <ul>
            {moves.map(item => (
                <PokeMoveCard/>
            ))}
        </ul>
    </div>
  )
}

export default PokeMoves
